import React from "react";
import { useNavigate } from "react-router-dom";
import "../css/home.css";
import "../css/button.css";


function Home() {
  const navigate = useNavigate();


  const handleBioClick = () => {
    navigate("/bio");
  };

  const handleProjectsClick = () =>{
    navigate("/projects")
  }

  return (
    <div className="container">
      <div className="home-div size">
        <p>Hi, I'm Swavik.</p>
        <button className="bw-button" onClick={handleBioClick}>
          Bio
        </button>
      </div>
      <div className="home-div sizee vertical-line">
        <p>
          I'm Swavik, a software developer. 
          <br/>
          I design and build computer programs and applications.
          <br />
          I write code to solve problems and create useful tools for users.{" "}
          <br />
          I often work in teams to improve software functionality and
          performance. 
          <br />
          I continuously learn new technologies to keep my
          skills updated.
        </p>
        <button className="bw-button" onClick={handleProjectsClick}>
          Projects
        </button>
      </div>
    </div>
  );
}

export default Home;
